from http.server import BaseHTTPRequestHandler
import base64
import brotli

# Pre-compressed stock database (Brotli + Base64)
COMPRESSED_DATA = """"""

class handler(BaseHTTPRequestHandler):
    """Serverless function handler for Vercel."""

    def do_GET(self):
        try:
            # Decode and decompress the stock data
            compressed_bytes = base64.b64decode(COMPRESSED_DATA)
            
            # Send compressed response directly (browser will decompress)
            self.send_response(200)
            self.send_header('Content-Type', 'application/json')
            self.send_header('Content-Encoding', 'br')
            self.send_header('Content-Length', str(len(compressed_bytes)))
            self.send_header('Access-Control-Allow-Origin', '*')
            self.send_header('Cache-Control', 'public, max-age=86400')
            self.send_header('Vary', 'Accept-Encoding')
            self.end_headers()
            self.wfile.write(compressed_bytes)

        except Exception as e:
            print(f"Error: {str(e)}")
            import json
            self.send_response(500)
            self.send_header('Content-Type', 'application/json')
            self.send_header('Access-Control-Allow-Origin', '*')
            self.end_headers()
            error_response = json.dumps({
                'success': False,
                'error': str(e),
                'message': 'Failed to load stock database'
            })
            self.wfile.write(error_response.encode())

    def do_OPTIONS(self):
        """Handle CORS preflight."""
        self.send_response(200)
        self.send_header('Access-Control-Allow-Origin', '*')
        self.send_header('Access-Control-Allow-Methods', 'GET, OPTIONS')
        self.send_header('Access-Control-Allow-Headers', 'Content-Type')
        self.end_headers()
